    return (
      <BrowserRouter>
        <Switch>
          <Route path="/" exact component={Logon} />
          {/* <Route path="/register" component={Register} />

          <Route path="/profile" component={Profile} />
          <Route path="/incidents/new" component={NewIncident} /> */}
        </Switch>
      </BrowserRouter>
    );
  }
